  "text" : "\"\uB2E4\uB978 \uC774\uB4E4\uCC98\uB7FC, \uBB34\uB300 \uC704 \uBAA8\uC2B5\uC758 \uC774\uBA74\uC744 \uC880 \uB354 \uBCF4\uC5EC\uC8FC\uB294 \uBCF4\uC644\uC7AC\uB85C\uC11C\uC758 \uC18C\uD1B5\uC774 \uC544\uB2C8\uB2E4. \uC791\uD488\uACFC \uD55C\uB370 \uB9DE\uBB3C\uB824 \uB3CC\uC544\uAC00\uB294 \uC11C\uC0AC\uB85C\uC11C\uC758 \uC5D0\uC2A4\uC5D4\uC5D0\uC2A4 \uD65C\uB3D9\uC774\uB2E4. \uBC29\uD0C4\uC18C\uB144\uB2E8\uC774 \uC5D0\uC2A4\uC5D4\uC5D0\uC2A4\uC5D0\uC11C \u2018\uD574\uB0B8 \uAC83\u2019\uC774 \uBC14\uB85C \uADF8\uAC83\uC774\uB2E4.\"",
