  "text" : "\uAC10\uB3C5\uC774\uC790 \uC8FC\uC778\uACF5\uC778 \uC5EC\uC131\uC774 \uAC08\uB4F1\uC744 \uC9C1\uBA74\uD558\uACE0 \uB300\uD654\uB85C \uD480\uC5B4\uB098\uAC00\uB294 \uACFC\uC815 \uC18D\uC5D0\uC11C \uC5EC\uB7EC \uC544\uD514\uACFC \uACE0\uD1B5\uC774 \uB4E4\uC5B4\uB0AC\uC744 \uB54C \uBD84\uB178\uD588\uB2E4\uAC00 \uC2AC\uD390\uB2E4\uAC00 \uB300\uB2E8\uD558\uB2E4\uACE0 \uB290\uAF08\uB2E4. \uBCF4\uBA74\uC11C \uC815\uB9D0 \uC5EC\uB7EC\uAC10\uC815\uC774 \uAD50\uCC28\uD574\uAC14\uB2E4. \uADF8\uB4E4\uC774 \uC55E\uC73C\uB85C \uADF8\uB824\uAC08 \uBAA8\uC2B5\uC774 \uAE30\uB300\uB41C\uB2E4.",
